import React from 'react';
import {Link} from 'react-router-dom';

const ListingDisplay = (props) => {

    const renderData = ({listData}) =>{
        if(listData){
            if(listData.length > 0){
                return listData.map((item)=>{
                    return(
                        <div className="item" key={item._id}>
                            <div className="row">
                                <div className="col-md-5">
                                    <img src={item.restaurant_thumb} className="Image"
                                    alt={item.restaurant_name}/>
                                </div>
                                <din className="col-md-7">
                                    <div className="hotel_name">
                                        <Link to="/">{item.restaurant_name}</Link>
                                    </div>
                                    <div className="city_name">{item.address}</div>
                                    <div className="city_name">{item.rating_text}</div>
                                    <div className="city_name">Rs.{item.cost}</div>
                                    <div className="labelDiv">
                                        <span className="label label-primary">
                                            {item.mealTypes[0].mealtype_name}
                                        </span>&nbsp;
                                        <span className="label label-success">
                                            {item.mealTypes[1].mealtype_name}
                                        </span>
                                    </div>
                                    <div className="labelDiv">
                                        <span className="label label-warnig">
                                            {item.cuisines[0].cusines_name}
                                        </span> &nbsp;
                                        <span className="label label-info">
                                            {item.cuisines[1].cusines_name}
                                        </span>
                                    </div>
                                </din>
                            </div>
                        </div>
                    )
                })
            }else{
                return(
                    <div>
                        <h2>No Data Found for filter</h2>
                    </div>
                )
            }
        }else{
            return(
                <div>
                    <h2>Loading</h2>
                    <img src="/images/loader.gif" alt="loader"/>
                </div>
            )
        }
    }
    return(
        <div id="content">
            {renderData(props)}
        </div>
    )
}

export default ListingDisplay;
